import Title from './Title'
import Content from './Content'
  const birthdayList = [{
    date: 'Mar 14',
    firstName: 'Luke', 
    lastName: 'Skywalker'},{
    date: 'Dec 29',
    firstName: 'Darth', 
    lastName: 'Vader'},{
    date: 'Feb 8',
    firstName: 'lipum', 
    lastName: 'holler'},{
    date: 'Sept 22',
    firstName: 'han', 
    lastName: 'solo'},{
    date: 'Aug 18',
    firstName: 'fooooo',
    lastName: 'baaaaaaaz'}
    ]

function App() {
  return (
    <div className="App">
      <header >
      </header>
      <div className="App-body">
        <Title />
        <Content 
          birthdayList= {birthdayList}
        />
      </div>
    </div>
  );
}

export default App;
